CREATE TABLE driver(
    driver_id VARCHAR2(2) PRIMARY KEY,
    name VARCHAR2(15) NOT NULL,
    surname VARCHAR2(30) NOT NULL,
    OIB VARCHAR2(11) NOT NULL,
    mail VARCHAR2(40) NOT NULL,
    phone VARCHAR(10) NOT NULL,
    contract_date DATE NOT NULL,
    contract_type VARCHAR2(1) NOT NULL,
    money_per_hour FLOAT NOT NULL,
    adress VARCHAR2(40) NOT NULL,
    blood_type VARCHAR2(2),
    birth_date DATE
);

CREATE TABLE schedule(
    schedule_id VARCHAR2(5) PRIMARY KEY,
    month INTEGER NOT NULL,
    year INTEGER NOT NULL,
    driver_id VARCHAR2(10) REFERENCES driver(driver_id)
);

CREATE TABLE shift(
    shift_id VARCHAR2(5) PRIMARY KEY,
    day DATE NOT NULL,
    type INTEGER NOT NULL REFERENCES  shift_type(type),
    schedule_id VARCHAR2(5) REFERENCES schedule(schedule_id)
    );

CREATE TABLE shift_type(
	type INTEGER PRIMARY KEY,
    lenght INTEGER NOT NULL,
    start_time INTEGER NOT NULL
);

CREATE TABLE phone(
    phone_id VARCHAR2(2) PRIMARY KEY,
    phone_number VARCHAR2(10) NOT NULL
    );
    
CREATE TABLE vehicle(
    vehicle_id VARCHAR2(2) PRIMARY KEY,
    brand VARCHAR2(10) NOT NULL,
    model VARCHAR2(10) NOT NULL,
    year INTEGER NOT NULL,
    fuel_type VARCHAR2(10) NOT NULL,
    seats INTEGER NOT NULL,
    mechanic_info CLOB,
    kilometers INTEGER
);

CREATE TABLE ride(
    ride_id VARCHAR2(10) PRIMARY KEY,
    shift_id INTEGER NOT NULL REFERENCES shift(shift_id),
    phone_number INTEGER NOT NULL,
    passenger_number INTEGER NOT NULL,
    price INTEGER NOT NULL,
    pickup_point VARCHAR2(30) NOT NULL,
    destination_point VARCHAR2(30) NOT NULL,
    order_time_date TIMESTAMP NOT NULL,
    status VARCHAR2(1) NOT NULL,
    phone_id VARCHAR2(2) NOT NULL references phone(phone_id),
    vehicle_id VARCHAR2(2) NOT NULL references vehicle(vehicle_id)
    );

    
CREATE TABLE expenses(
    info VARCHAR2(60) NOT NULL,
    cost FLOAT(4),
    shift_id VARCHAR2(5) NOT NULL REFERENCES shift(shift_id)
    );
 
   
